import { createGlobalStyle } from "styled-components";

import reset from "styled-reset";

export const lightTheme = {};
export const darkTheme = {
  fontColor: "white",
  bgColor: "#2c2c2c",
};

export const GlobalStyles = createGlobalStyle`${reset}`;
